const express = require('express');
const router = express.Router();
const axios = require('axios');

const coins = {
    'cryowar-token': 0.028,
    'good-games-guild': 0.3,
    'gaia-everworld': 0.16,
    'acknoledger': 0.1,
    'hero-arena': 0.1,
    'defina-finance': 0.2,
    'bloktopia': 0.00025,
    'continuum-world': 0.015,
    'cryptoblades-kingdoms': 0.04,
    'forest-knight': 0.15,
    'monsters-clan': 0.15,
    'snook': 0.32,
    'pocoland': 0.1,
    'cryptomeda': 0.014,
    'fanadise': 0.12,
    'landshare': 0.8,
    'wizard-token': 0.5
}

const fetchSingleCoinData = async (coinId) => {
    const response = await axios.get(`https://api.coingecko.com/api/v3/coins/${coinId}?localization=false&tickers=false&community_data=false&developer_data=false&sparkline=false
`);

    console.log(coinId + " fetched")

    const ath = response.data["market_data"]["ath"]["usd"];
    const current = response.data["market_data"]["current_price"]["usd"];
    const name = response.data["name"];
    const image = response.data["image"]["thumb"];

    return {
        ath: +ath.toFixed(2),
        current: +current.toFixed(2),
        athROI: +(ath / coins[coinId]).toFixed(2),
        currentROI: +(current / coins[coinId]).toFixed(2),
        name,
        image
    };
}


const fetchDataWithCache = () => {
    let data = {};
    let reFetch = true; // ensures that every second request is served from cache, needed because of JetEngine flaws
    return async () => {
        if (reFetch) {
            data = await Promise.all(Object.keys(coins).map(fetchSingleCoinData))
        }
        reFetch = !reFetch;
        return data;
    }
}

const fetchData = fetchDataWithCache();

router.get('/overview', async function (req, res) {

    const returns = await fetchData();

    const sortedReturns = [...returns].sort((a, b) => b.athROI - a.athROI);
    const highestXCoin = sortedReturns[0];
    const lowestXCoin = sortedReturns[returns.length - 1];

    const avgXAllCoins = +(returns.reduce((a, b) => a + b.athROI, 0) / returns.length).toFixed(2)

    const avgX = {
        label: "Average ROI",
        value: avgXAllCoins,
    }

    const highestX = {
        label: `Maximum ROI (${highestXCoin.name})`,
        value: highestXCoin.athROI,
    }

    const lowestX = {
        label: `Minimum ROI (${lowestXCoin.name})`,
        value: lowestXCoin.athROI
    }

    return res.json([highestX, avgX, lowestX]);
})

router.get('/detailed', async function (req, res) {
    const returns = await fetchData();

    const detailedROIs = returns.map((coin, i) => {
        const coingeckoId = Object.keys(coins)[i];
        return ({...coin, coingeckoId, igoPrice: coins[coingeckoId]});
    })

    return res.json(detailedROIs)
});

module.exports = router;

