    const lowestXCoin = sortedReturns[returns.length - 1]

    const avgXAllCoins = +(
        returns.reduce((a, b) => a + b.athROI, 0) / returns.length
    ).toFixed(2)

    const avgX = {
        label: 'Average ROI',
        value: avgXAllCoins,
    }

    const highestX = {
        label: `Maximum ROI (${highestXCoin.name})`,
        value: highestXCoin.athROI,
    }

    const lowestX = {
        label: `Minimum ROI (${lowestXCoin.name})`,
        value: lowestXCoin.athROI,
    }

    return [highestX, avgX, lowestX]
}

module.exports = {
    getOverview,
}

